import React from 'react'


const handleSubmit = (e) => {
    e.preventDefault()
}

function CreateProduct() {
  return (
    <div className='w-full py-12'>
      <form onSubmit={handleSubmit} className='flex flex-col gap-4 container mx-auto w-[400px]'>
        <input className='p-2' type="text" placeholder='Product name' />
        <input className='p-2' type="number" placeholder='Product price' />
        <input className='p-2' type="text" placeholder='Product category' />
        <input className='p-2' type="text" placeholder='Product description' />

        <button className='w-full bg-lime-500 p-2'>Add item</button>
      </form>
    </div>
  )
}

export default CreateProduct
